import React from "react";
import { ResultProps } from "../models/dataModels";

const SearchResults = (props: ResultProps) => {
  return (
    <div>
      <ul>
        <li>Name: {props.result.name}</li>
        <li>Year Released: {props.result.year}</li>
        <li>Theme Name: {props.result.name}</li>
        <li>Number of Parts: {props.result.name}</li>
      </ul>
    </div>
  );
};

export default SearchResults;
